import React, { useEffect, useState } from "react";
import axios from "axios";
import { DragDropContext, Droppable, Draggable } from "react-beautiful-dnd";
import TodoItem from "../components/TodoItem";

export default function Home({ token, setToken }) {
  const [todos, setTodos] = useState([]);
  const [task, setTask] = useState("");
  const [dueDate, setDueDate] = useState("");

  const api = axios.create({
    baseURL: process.env.REACT_APP_API_URL,
    headers: { Authorization: `Bearer ${token}` },
  });

  const fetchTodos = async () => {
    const res = await api.get("/todos");
    setTodos(res.data);
  };

  useEffect(() => {
    fetchTodos();
  }, []);

  const addTodo = async (e) => {
    e.preventDefault();
    if (!task.trim()) return;
    await api.post("/todos", {
      text: task,
      dueDate,
      category: "important_urgent",
    });
    setTask("");
    setDueDate("");
    fetchTodos();
  };

  const logout = () => {
    setToken(null);
    localStorage.removeItem("token");
  };

  const categories = {
    important_urgent: "Important & Urgent",
    important_not_urgent: "Important but Not Urgent",
    not_important_urgent: "Urgent but Not Important",
    not_important_not_urgent: "Not Important & Not Urgent",
  };

  const onDragEnd = async (result) => {
    if (!result.destination) return;

    const { draggableId, destination } = result;
    const newCategory = destination.droppableId;

    await api.put(`/todos/${draggableId}`, { category: newCategory });
    fetchTodos();
  };

  return (
    <div className="container" style={{ padding: "20px" }}>
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
        <h2>ðŸ—‚ Priority To-Do Dashboard</h2>
        <button onClick={logout} style={{ background: "crimson", color: "#fff", border: "none", padding: "6px 10px" }}>
          Logout
        </button>
      </div>

      <form onSubmit={addTodo} style={{ marginTop: "20px" }}>
        <input
          type="text"
          placeholder="Add a new task..."
          value={task}
          onChange={(e) => setTask(e.target.value)}
          style={{ width: "40%", marginRight: "10px" }}
        />
        <input type="date" value={dueDate} onChange={(e) => setDueDate(e.target.value)} />
        <button type="submit" style={{ marginLeft: "10px" }}>Add</button>
      </form>

      <DragDropContext onDragEnd={onDragEnd}>
        <div
          style={{
            display: "grid",
            gridTemplateColumns: "repeat(4, 1fr)",
            gap: "20px",
            marginTop: "30px",
          }}
        >
          {Object.entries(categories).map(([key, title]) => (
            <Droppable droppableId={key} key={key}>
              {(provided) => (
                <div
                  {...provided.droppableProps}
                  ref={provided.innerRef}
                  style={{
                    background: "#f8f9fa",
                    borderRadius: "12px",
                    padding: "15px",
                    minHeight: "400px",
                    boxShadow: "0 2px 5px rgba(0,0,0,0.1)",
                  }}
                >
                  <h3 style={{ textAlign: "center", color: "#333" }}>{title}</h3>
                  {todos
                    .filter((t) => t.category === key)
                    .map((todo, index) => (
                      <Draggable key={todo._id} draggableId={todo._id} index={index}>
                        {(provided) => (
                          <div
                            ref={provided.innerRef}
                            {...provided.draggableProps}
                            {...provided.dragHandleProps}
                            style={{
                              marginBottom: "8px",
                              ...provided.draggableProps.style,
                            }}
                          >
                            <TodoItem todo={todo} refresh={fetchTodos} api={api} />
                          </div>
                        )}
                      </Draggable>
                    ))}
                  {provided.placeholder}
                </div>
              )}
            </Droppable>
          ))}
        </div>
      </DragDropContext>
    </div>
  );
}
